  return (
    <div className="TransactionDetail">
      <h1> Transaction Detail  </h1>

      <div className='Transaction_Card'>
          <div className='TransactionD_Container'> 
          <p> <b> John Doe </b></p>
          </div>
                  
      </div>
    </div>
  );
}

export default TransactionDetail;
